css:
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: #808080;
  padding: 5px;
  border-bottom: 1px solid #cccccc;
  display: flex;
  align-items: center;
}
.github-Accordion-header::-webkit-details-marker {
  color: #808080;
}
.github-Accordion--rightTitle,
.github-Accordion--leftTitle {
  flex: 1;
}
.github-Accordion-content {
  border-bottom: 1px solid #cccccc;
  background-color: #ebebeb;
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: #808080;
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: #141414;
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 2.5px;
  border-bottom: 1px solid #cccccc;
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: #d6d6d6;
}
